    const [data, setData] = useState("");
    const { id } = useParams();
    const userID = id;
    
      useEffect(() => {
        document.title = "Genetech Team";
        userDetail();
      },[userID]);

      const userDetail = () => {
        UserService.getSignleUser(userID).then(
          (response) => {
            setData(response.data.user);
          },
          (error) => {
            const _content =
              (error.response && error.response.data) ||
              error.message ||
              error.toString();
              setData(_content);
          }
        );
      }

    return (
          <div className="Users">
              {document.title}
              <ul>
                { 
                  Object.keys(data).map((anObjectMapped, index) => {
                    const val = data[anObjectMapped];

                    return <li>
                              <h3>{val.name}</h3>
                              <span>{val.email}</span>
                            </li>
                })

                  }
              </ul>

          <div>
          
        
          </div>
              
          </div>
    );
    }
export default User;
